INSERT INTO `wp_posts` VALUES("17", "1", "2015-06-03 18:12:27", "2015-06-03 18:12:27", "This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\r\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like piña coladas. (And gettin\' caught in the rain.)</blockquote>\r\n...or something like this:\r\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\r\nAs a new WordPress user, you should go to <a href=\"http://foothillprint.dev/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!", "Home", "", "inherit", "open", "open", "", "2-revision-v1", "", "", "2015-06-03 18:12:27", "2015-06-03 18:12:27", "", "2", "http://foothillprint.dev/2015/06/03/2-revision-v1/", "0", "revision", "", "0");
